prompt_example:
Δεδομένου ότι Ο vaquero ή buckaroo είναι ένας δυτικός και ο cowboy είναι ένας νότιος. Επομένως, πρέπει να ισχύει ότι "Ο καουμπόι είναι από το νότο."; Ναι, όχι, ή ίσως;
Ναί

Δεδομένου ότι Δεν πήγε να πάει. Επομένως, πρέπει να ισχύει ότι "Δεν του επετράπη να πάει στα εγκαίνια του μουσείου."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Δεν θα εκραγεί χωρίς πυροδότηση. Επομένως, πρέπει να ισχύει ότι "Ο πυροκροτητής κάνει την βόμβα να εκραγεί .."; Ναι, όχι, ή ίσως;
Μπορεί

Δεδομένου ότι Του το είπα ήδη, προσπάθησα να του εξηγήσω ότι ήμουν απογοητευμένος που δεν είχα όλες τις πληροφορίες που χρειαζόμουν. Επομένως, πρέπει να ισχύει ότι "Του είπα ότι δεν ήθελα να ακούσω τίποτε άλλο."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Δεν ήθελαν να μείνουν αιχμάλωτοι Επομένως, πρέπει να ισχύει ότι "Όλοι τρομοκρατήθηκαν στο να αποδεσμευθούν από την επιτήρηση."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Το προσωπικό εργάζεται σε ένα πρόγραμμα για την αύξηση του αριθμού των φλαμίνγκο στις αμερικανικές Παρθένες Νήσους, και θα βρείτε ένα μικρό κοπάδι εδώ επιτυχούς εκτροφής κάθε χρόνο. Επομένως, πρέπει να ισχύει ότι "Το προσωπικό εργάζεται για την εξάλειψη των φλαμίνγκο."; Ναι, όχι, ή ίσως;
Οχι

Δεδομένου ότι Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Επομένως, πρέπει να ισχύει ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
